public final class ByteCodeDemo implements IByteCodeTest, IByteCodeTest2{

    @Deprecated
    private String test1 = "12345";
    @TestAnnotation
    public String test2 = "123456";
    private final Integer test3 = 5555;
    Float test4 = 6666.888888888f;
    protected Double test5 = 123456789098765431.123456789098765431;
    private volatile Long test6 = 8888877777778L;
    public transient int theFinal = -9999;

    // 最大长度 65534
//    static String tests1 = "";

    public static void main(String[] args) throws Throwable{
        String classFilePath = "/Users/user/whn_project/Bytecode/target/classes/com/whn/ByteCodeDemo.class";
        MyClassFile classFile = analy(classFilePath);
        show(classFile);
    }

    /**
     * 解析
     * @param classFilePath class文件路径
     * @return
     * @throws Throwable
     */
    private static MyClassFile analy(@NotNull String classFilePath)throws Throwable{
        FileInputStream fileInputStream = null;
        DataInputStream dataInputStream = null;
        try{
            fileInputStream = new FileInputStream(classFilePath);
            dataInputStream = new DataInputStream(fileInputStream);

            // 初始化 class 字节码
            ByteInfo.init(dataInputStream);
            // 开始解析
            MyClassFile classFile = new MyClassFile();
            classFile.analy();
            return classFile;
        }catch(Throwable e){
            throw e;
        }finally{
            if(null != fileInputStream){
                fileInputStream.close();
            }
            if(null != dataInputStream){
                dataInputStream.close();
            }
        }
    }

    /**
     * 展示信息
     * @param classFile
     * @throws Throwable
     */
    private static void show(MyClassFile classFile)throws Throwable{
        if(null != classFile){
            Scanner scanner = new Scanner(System.in);
            String operate;
            String showInfo = "输入类型,1.概要信息,2.常量池信息,3.字段信息,4.接口信息,5.方法信息,6.Attributes";
            String tipInfo = "\"输入操作符: ";
            System.out.println(showInfo);
            System.out.print(tipInfo);
            operate = scanner.next();

            while(!"quit".equals(operate) && !"exit".equals(operate)){
                switch(operate){
                    case "1":
                        classFile.showInfo();
                        break;
                    case "2":
                        // 常量池
                        classFile.showConstantPools();
                        break;
                    case "3":
                        classFile.showFields();
                        break;
                    case "4":
                        classFile.showInterfaces();
                        break;
                    case "5":
                        classFile.showMethods();
                        break;
                    case "6":
                        classFile.showAttributes();
                        break;
                    default:
                        System.out.println("unknown operate.");
                }

                System.out.println("\n\n"+showInfo);
                System.out.print(tipInfo);
                operate = scanner.next();
            }
        }else{
            System.out.println("class has no analyse");
        }
    }

    @Override
    public void test1(String test){

    }

    @Override
    public Integer test2(){
        return 5;
    }
}
